|Game Description|
+----------------+

Can you keep the garden gnome population under control? Bash gnomes as quickly as you can while keeping an eye out for special gnomes, prizes and power-ups. It's a smashing good time!

Originally released May 23rd, 2006.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows 98, ME, 2000, XP, Vista(32/64bit) and 7(32/64bit). Requires DirectX 7.0 or later. Processor requirements: 500MHz CPU or higher. RAM requirements: 128 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 16 MB of video memory.

